import React, { useState } from 'react';

function ClientRegistrationForm({ onSubmit, onCancel }) {
    const [client, setClient] = useState({
        registrationStatus: '신규',
        name: '',
        counselingTopics: '', // 상담 주제를 콤마로 입력받음
        contactNumber: '',
        gender: '',
        age: '',
        registrationDate: new Date().toISOString().split('T')[0],
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setClient((prevClient) => ({
            ...prevClient,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        // 상담 주제를 문자열로 처리 (콤마로 구분된 문자열)
        const topicsString = client.counselingTopics
            .split(',')
            .map((topic) => topic.trim())
            .filter((topic) => topic.length > 0)
            .join(',');

        const formattedClient = {
            ...client,
            counselingTopics: topicsString, // 문자열로 변환하여 전달
        };

        console.log("Formatted client data:", formattedClient); // 디버깅용
        onSubmit(formattedClient);

        // 폼 초기화
        setClient({
            registrationStatus: '신규',
            name: '',
            counselingTopics: '',
            contactNumber: '',
            gender: '',
            age: '',
            registrationDate: new Date().toISOString().split('T')[0],
        });
    };

    return (
        <form onSubmit={handleSubmit} className="client-form">
            <h2>내담자 등록</h2>
            <div>
                <label>상태:</label>
                <select name="registrationStatus" value={client.registrationStatus} onChange={handleChange}>
                    <option value="신규">신규</option>
                    <option value="진행중">진행중</option>
                </select>
            </div>
            <div>
                <label>이름:</label>
                <input type="text" name="name" value={client.name} onChange={handleChange} required />
            </div>
            <div>
                <label>상담 주제 (콤마로 구분):</label>
                <input
                    type="text"
                    name="counselingTopics"
                    value={client.counselingTopics}
                    onChange={handleChange}
                    placeholder="예: 진로 상담, 스트레스 관리"
                    required
                />
            </div>
            <div>
                <label>연락처:</label>
                <input
                    type="tel"
                    name="contactNumber"
                    value={client.contactNumber}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label>성별:</label>
                <select name="gender" value={client.gender} onChange={handleChange} required>
                    <option value="">선택</option>
                    <option value="남">남</option>
                    <option value="여">여</option>
                </select>
            </div>
            <div>
                <label>나이:</label>
                <input
                    type="number"
                    name="age"
                    value={client.age}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label>등록일:</label>
                <input
                    type="date"
                    name="registrationDate"
                    value={client.registrationDate}
                    onChange={handleChange}
                    required
                />
            </div>
            <div className="form-buttons">
                <button type="submit">등록</button>
                <button
                    type="button"
                    onClick={() => {
                        onCancel();
                        setClient({
                            registrationStatus: '신규',
                            name: '',
                            counselingTopics: '',
                            affiliation: '',
                            contactNumber: '',
                            gender: '',
                            age: '',
                            registrationDate: new Date().toISOString().split('T')[0],
                        });
                    }}
                >
                    취소
                </button>
            </div>
        </form>
    );
}

export default ClientRegistrationForm;
